        "source": "pragma solidity ^0.8.9;\r\n\r\ncontract LawfulLand {\r\n    // Model a Land\r\n    struct Land {\r\n        int256 LANDNUM;\r\n        int256 NICAD;\r\n        int256 CNI;\r\n        string FIRSTNAME;\r\n        string LASTNAME;\r\n        int256 SUPERFICIE;\r\n    }\r\n\r\n    // Read/write Land : mapping generates automatically getters\r\n    mapping(int256 => Land) public lands;\r\n    // Store Lands count used like a new land id\r\n    int256 public landsCount = 0;\r\n\r\n    // init all saved land\r\n    constructor() public {\r\n        addLand(\r\n            12345,\r\n            123456789012,\r\n            12345678901234567,\r\n            \"MAMADOU\",\r\n            \"NDIAYE\",\r\n            200\r\n        );\r\n        addLand(12345, 123456789912, 12345678901234567, \"test\", \"test\", 300);\r\n        addLand(12345, 812345678912, 12345678901234567, \"Bamba\", \"Diop\", 400);\r\n    }\r\n\r\n    // add new land after verification\r\n    function addLand(\r\n        int256 _LANDNUM,\r\n        int256 _NICAD,\r\n        int256 _CNI,\r\n        string memory _FIRSTNAME,\r\n        string memory _LASTNAME,\r\n        int256 _SUPERFICIE\r\n    ) public {\r\n        int256 landCopy;\r\n        for (int256 i = 0; i < landsCount + 1; i++) {\r\n            if (lands[i].NICAD == _NICAD) {\r\n                landCopy = 1;\r\n            }\r\n        }\r\n        if (landCopy == 0) {\r\n            landsCount++;\r\n            lands[landsCount] = Land(\r\n                _LANDNUM,\r\n                _NICAD,\r\n                _CNI,\r\n                _FIRSTNAME,\r\n                _LASTNAME,\r\n                _SUPERFICIE\r\n            );\r\n        }\r\n    }\r\n\r\n    // verify land informations gived to the buyer by the owner return bool\r\n    function verifyLand(\r\n        int256 _id,\r\n        int256 _NICAD,\r\n        int256 _CNI,\r\n        string memory _FIRSTNAME,\r\n        string memory _LASTNAME,\r\n        int256 _SUPERFICIE\r\n    ) public view returns (int256) {\r\n        for (int256 i = 0; i < landsCount + 1; i++) {\r\n            if (\r\n                lands[i].LANDNUM == _id &&\r\n                lands[i].NICAD == _NICAD &&\r\n                lands[i].CNI == _CNI &&\r\n                keccak256(abi.encodePacked(lands[i].FIRSTNAME)) ==\r\n                keccak256(abi.encodePacked(_FIRSTNAME)) &&\r\n                keccak256(abi.encodePacked(lands[i].LASTNAME)) ==\r\n                keccak256(abi.encodePacked(_LASTNAME)) &&\r\n                keccak256(abi.encodePacked(lands[i].SUPERFICIE)) ==\r\n                keccak256(abi.encodePacked(_SUPERFICIE))\r\n            ) {\r\n                return 1;\r\n            }\r\n        }\r\n        return 0;\r\n    }\r\n}\r\n",
